<p><hi rend="bold">كۋېنسلاند</hi> بولسا <ref target="https://ug.wikipedia.org/wiki/ئاۋستىرالىيە">ئاۋستىرالىيە</ref> دىكىبىخاھار 2009 نوپۇس بار، كۋېنسلاندنىڭ 4،406،800 نوپۇسىبار، 1،852،642 كۋادرات كىلومېتىر دائىرائىقىدا نوپۇس جايلاخكان، خىمالىكاڭ لىك 23.0°، خارىكى ئۇزۇنلۇك 143°0.</p></text></body></html>
